import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import * as serviceWorker from './serviceWorker';

//dependencies
import {BrowserRouter as Router} from "react-router-dom"

ReactDOM.render(
<Router>
    <App />
</Router>,
document.getElementById('root'));

serviceWorker.register();
